        /// <summary>
        /// Finds the best matching card from an array of RGB values using template-matching.
        /// </summary>
        /// <param name="input">RGB Pixels</param>
        /// <returns>The card, that most likely is represented by the <paramref name="input"/>.</returns>
        private ExtractedCard FindBestCard(byte[] input)
        {
            int lowestDiff = int.MaxValue;
            int lowestDiffIndex = 0;

            for (int iCard = 0; iCard < this.cards.Length; iCard++)
            {
                int currentDiff = 0;
                for (int iByte = 0; iByte < ARRAY_LEN; iByte++)
                {
                    currentDiff += Math.Abs(input[iByte] - CARD_COLORS[iCard][iByte]);
                }

                if (currentDiff < lowestDiff)
                {
                    lowestDiffIndex = iCard;
                    lowestDiff = currentDiff;

                    if (currentDiff == 0)
                    {
                        break;
                    }
                }
            }

            return new ExtractedCard(this.cards[lowestDiffIndex], lowestDiff);
        }

        /// <summary>
        /// Gets the card at a specific position using template matching.
        /// </summary>
        /// <param name="xBase">The x-coordinate of corner of the cards suit.</param>
        /// <param name="yBase">The y-coordinate of corner of the cards suit.</param>
        /// <returns>The card, that is most likely at the given position.</returns>
        public ExtractedCard GetCardAt(int xBase, int yBase)
        {
            byte[] colors = new byte[ARRAY_LEN];

            using (Bitmap bmp = new Bitmap(16, 16))
            {
                using (Graphics graphics = Graphics.FromImage(bmp))
                {
                    graphics.CopyFromScreen(xBase, yBase, 0, 0, new Size(16, 16));
                }

                short iByte = 0;
                for (short x = 0; x < 16; x++)
                {
                    for (short y = 0; y < 16; y++)
                    {
                        Color c = bmp.GetPixel(x, y);
                        colors[iByte++] = c.R;
                        colors[iByte++] = c.G;
                        colors[iByte++] = c.B;
                    }
                }
            }

            return FindBestCard(colors);
        }
    }
